import React from "react";
// import "./post-component.css";

function PostCoponent({ profile, post }) {
  return (
    <article className="post-component">
      <header>
        <img
          src={
            profile
              ? profile.img
              : "https://www.flaticon.com/svg/static/icons/svg/1256/1256650.svg"
          }
        />
        <div>
          <h2>{profile.name}</h2>
          <p>{profile.follower}</p>
        </div>
      </header>
      <maim>
        <img src={post.image} />
        <p>{post.detail}</p>
      </maim>
      <footer>
        <div className="post-footer-left">
          <p>like: {post.numberOfLike}</p>
          <p>comment: {post.numberOfComment}</p>
          <p>Chat</p>
        </div>
        <div className="post-footer-right"></div>
      </footer>
    </article>
  );
}

export default PostCoponent;
